import React, { useRef, useState } from 'react';
import PropTypes from 'prop-types';

import { makeStyles } from '@material-ui/core/styles';

import theme from '../../theme';
import { linkoutProps } from '../defaults';

import { Container, Grid, Link, Typography } from '@material-ui/core';
import { ListItem, ListItemText, ListItemIcon } from '@material-ui/core';
import { Slide } from '@material-ui/core';
import { SvgIcon } from '@material-ui/core';


const features = [
  {
    title: 'Get the Enrichment Analysis automatically',
    description: <>
      Just provide your RNA-Seq expression data or your pre-ranked gene list, and we run the&nbsp;
      <Link href="https://www.biorxiv.org/content/10.1101/060012v3" {...linkoutProps}>gene set enrichment analysis</Link> for you.
    </>,
    icon: DataIcon,
    screen: ImportScreen,
  },
  {
    title: 'Create a similarity network',
    description: <>
      Visualise the results as a network of gene sets &#40;i.e. pathways&#41;, 
      where highly redundant gene sets are grouped into clusters for easier interpretation.
    </>,
    icon: NetworkIcon,
    screen: NetworkScreen,
  },
  {
    title: 'Download figures for publication',
    description: <>
      Get network figures and auxiliary data to communicate the results of the analysis to collaborators and for publication.
    </>,
    icon: PaperIcon,
    screen: ImportScreen,
  },
];


export function PrimaryFeatures({ mobile, tablet }) {
  return (mobile || tablet) ? <FeaturesMobile /> : <FeaturesDesktop />;
}
PrimaryFeatures.propTypes = {
  mobile: PropTypes.bool,
  tablet: PropTypes.bool,
};

//==[ FeaturesDesktop ]===============================================================================================

const useFeaturesDesktopStyles = makeStyles(theme => ({
  screenContainer: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100%',
  },
  screenFrame: {
    backgroundColor: theme.palette.secondary.main,
    padding: theme.spacing(2),
    borderRadius: '16px',
  },
  screenContent: {
    backgroundColor: theme.palette.primary.main,
    padding: theme.spacing(6),
    borderRadius: '16px',
  },
  item: {
    display: 'flex',
    flexDirection: 'column',
    margin: theme.spacing(2, 0, 2, 0),
    padding: theme.spacing(2, 4, 2, 4),
    borderRadius: '16px',
  },
  itemSelected: {
    backgroundColor: `${theme.palette.background.default} !important`,
  },
  title: {
    marginTop: theme.spacing(1),
    marginBottom: theme.spacing(2),
    fontWeight: 'bold',
  },
  icon: {
    width: '2rem',
    height: '2rem',
  },
}));

function FeaturesDesktop() {
  const [ selectedIndex, setSelectedIndex ] = useState(0);
  
  const lastIndexRef = useRef(selectedIndex);

  const classes = useFeaturesDesktopStyles();

  const onChange = (index) => {
    if (index !== lastIndexRef.current) {
      setSelectedIndex(-1);
      setTimeout(() => {
        lastIndexRef.current = index;
        setSelectedIndex(index);
      }, 100);
    }
  };

  const Screen = features[lastIndexRef.current].screen;

  return (
    <Grid container>
      <Grid item xs={6}>
        <Slide direction="right" in={selectedIndex >= 0}>
          <Container className={classes.screenContainer}>
            <div className={classes.screenFrame}>
              <Screen />
            </div>
          </Container>
        </Slide>
      </Grid>
      <Grid item xs={6}>
      {features.map((feature, index) => (
        <ListItem
          key={feature.title}
          button
          alignItems="flex-start"
          selected={selectedIndex === index}
          onClick={() => onChange(index)}
          className={classes.item}
          classes={{ selected: classes.itemSelected}}
        >
          <ListItemIcon>
            <feature.icon className={classes.icon} />
          </ListItemIcon>
          <ListItemText
            primary={
              <Typography
                component="h3"
                variant="subtitle1"
                color="textPrimary"
                className={classes.title}
              >
                { feature.title }
              </Typography>
            }
            secondary={
              <Typography
                component="p"
                variant="body2"
                color="textSecondary"
                className={classes.inline}
              >
                { feature.description }
              </Typography>
            }
          />
        </ListItem>
      ))}
      </Grid>
    </Grid>
  );
}

